import React, { Component } from "react";

class Ninjas extends  Component{
    render() {
        // console.log(this.props);
        const { ninjas } = this.props;
        return(
            <div className="ninja">
                <div>Name: { ninjas.name } </div>
                <div>Age: { ninjas.age } </div>
                <div>Belt: { ninjas.belt } </div>
            </div>
        );
    }
}

export default Ninjas;
